def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if item > bins[i]:
            priorities[i] = 0
        else:
            remaining_space = bins[i] - item
            utilization_ratio = remaining_space / bins[i]

            if utilization_ratio < 0.1:
                priority_score = 1 / (1 + utilization_ratio)
            elif utilization_ratio >= 0.1 and utilization_ratio < 0.3:
                priority_score = 0.7 / (1 + utilization_ratio)
            elif utilization_ratio >= 0.3 and utilization_ratio < 0.6:
                priority_score = 0.5 / (1 + utilization_ratio)
            elif utilization_ratio >= 0.6 and utilization_ratio < 0.8:
                priority_score = 0.3 / (1 + utilization_ratio)
            else:
                priority_score = 0.1 / (1 + utilization_ratio)

            if remaining_space >= 5:
                priority_score *= 1.2
            elif remaining_space >= 3:
                priority_score *= 1.1

            if bins[i] >= 15:
                priority_score *= 1.4
            elif bins[i] >= 10:
                priority_score *= 1.3
            elif bins[i] >= 5:
                priority_score *= 1.2

            if item < 5:
                priority_score += 0.2
            elif item >= 5 and item < 10:
                priority_score += 0.1
            elif item >= 10 and item < 15:
                priority_score += 0.05

            if remaining_space > 0.5*bins[i]:
                priority_score += 0.1
            elif remaining_space <= 0.5*bins[i] and remaining_space > 0.3*bins[i]:
                priority_score += 0.05

            if bins[i] % 2 == 0:
                priority_score += 0.1
            elif bins[i] % 3 == 0:
                priority_score += 0.05

            priorities[i] = priority_score

    return priorities
